import React, { Component } from 'react';
import { BrowserRouter, Route } from 'react-router-dom';
import Login from './components/login';
import Home from "./components/home";

class App extends Component {
  render(){
    return(
      <BrowserRouter>
          <Route path="/">
            <Login/>
          </Route>
          <Route path="/home">
            <Home/>
          </Route>
      </BrowserRouter>
    )
  }
}

export default App;
